import Darkmode from './Component/DarkModeComp/darkmode';
import React from 'react'
import { ThemeProvider } from './context';

function App() {
  return (
    <div style={{backgroundColor:"black"}}>
    <ThemeProvider>
    <Darkmode/>
    <Intro/>
    <About/>
    <ProductList/>
    <Contact/>
    </ThemeProvider>
    </div>
  );
}

export default App;
